import React from 'react';
import Slider from '../../ui/components/Slider';
import {Code} from '../components/Code';
import {Tabs} from '../../ui/components/Tabs';

const SliderPage = () => {

    const handleChange = (value) => {
        console.log(value)
    }

    return ( 
        <>
            <h1 className="content__hdr">Slider</h1>
            <h4>Single slider</h4>
            <Tabs>
                <div title="View">
                    <div style={{width: 450}}>
                        <Slider 
                            defaultValue={3}
                            min={2}
                            max={18}
                        />
                    </div>    
                </div> 
                <div title="Code">
                    <Code>
                        {`<Slider defaultValue={3}\n\tmin={2}\n\tmax={18}\n/>`}
                    </Code>
                </div>
            </Tabs>

            <h4>Range slider</h4>
            <Tabs>
                <div title="View">
                    <div style={{width: 450}}>
                        <Slider 
                            range
                            defaultValue={[15, 50]}
                            defaultText={'Points'} 
                            onChange={handleChange}
                        />
                    </div>
                </div>
                <div title="Code">
                    <Code>
                        {`<Slider \n\trange\n\tdefaultValue={[15, 50]}\n\tdefaultText={'Points'}\n\tonChange={handleChange}\n/>`}
                    </Code>
                </div>
            </Tabs>
            <h4>Without text</h4>
            <Tabs>
                <div title="View">
                    <div style={{width: 450}}>
                        <Slider 
                            isHideText
                        />
                    </div>
                </div>
                <div title="Code">
                    <Code>
                        {`<Slider\n\tisHideText\n/>`}
                    </Code>
                </div>
            </Tabs>

        </>
    );
}

export default SliderPage;
